// [2,7,11,15] target=9

const twoSums = (arr, target) => {
//brute force method
  for (let i=0; i < arr.length; i++){
    for (let j=0; j < arr.length; j++){
      if(arr[i] + arr[j] === target && i !== j){
        return [i, j]
      }
    }
  }
}

export default twoSums;
